import {Alert} from './alert';
import {AlertType} from './alert-type.enum';
import {Injectable, signal} from '@angular/core';

const DEFAULT_TIMEOUT = 3500;

@Injectable({
  providedIn: 'root'
})
export class AlertService {
  private _alerts = signal<Alert[]>([]);
  public alerts = this._alerts.asReadonly();

  constructor() { }

  public show(message: string, type: AlertType, timeout?: number): void {
    this._alerts.update(alerts => [...alerts, {message: message, type: type, timeout: timeout}]);
    if (this._alerts().length > 1) {
      this.dismissPrevious();
    }
  }

  private dismissPrevious(): void {
    const alerts = this._alerts();
    const previousAlert = alerts[alerts.length - 2];
    setTimeout(() => this.dismiss(previousAlert), DEFAULT_TIMEOUT);
  }

  public showSuccess(message: string, timeout = DEFAULT_TIMEOUT): void {
    this.show(message, AlertType.Success, timeout);
  }

  public showDanger(message: string, timeout?: number): void {
    this.show(message, AlertType.Danger, timeout);
  }

  public showInfo(message: string, timeout?: number): void {
    this.show(message, AlertType.Info, timeout);
  }

  public showWarning(message: string, timeout?: number): void {
    this.show(message, AlertType.Warning, timeout);
  }

  public dismiss(dismissedAlert: Alert): void {
    this._alerts.update(alerts => alerts.filter(alert => alert !== dismissedAlert));
  }

  public clear(): void {
    this._alerts.set([]);
  }
}

import {inject, Injectable} from '@angular/core';
import {HttpClient} from '@angular/common/http';
import {Observable} from 'rxjs';
import {JwtHelperService} from '@auth0/angular-jwt';
import {AuthResponse} from './auth-response';
import {RefreshAccessTokenResponse} from './refresh-access-token-response';

const ACCESS_TOKEN_KEY = 'tm-access-token';
const REFRESH_TOKEN_KEY = 'tm-refresh-token';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  private jwtService = new JwtHelperService();
  private http = inject(HttpClient);
  private apiUrl = inject<string>('apiUrl' as any);

  public login(email: string, password: string): Observable<AuthResponse> {
    return this.http.post<AuthResponse>(`${this.apiUrl}/auth`, {email, password});
  }

  public refreshAccessToken(): Observable<RefreshAccessTokenResponse> {
    const request = {refreshToken: this.getStorageItem(REFRESH_TOKEN_KEY)}
    return this.http.post<RefreshAccessTokenResponse>(this.refreshAccessTokenUrl, request);
  }

  get refreshAccessTokenUrl(): string {
    return this.apiUrl + '/auth/refresh-access-token';
  }

  public isAuthenticated(): boolean {
    const accessToken = this.getAccessToken();
    const refreshToken = this.getRefreshToken();
    return !!accessToken && (!this.jwtService.isTokenExpired(accessToken) || (!!refreshToken && !this.jwtService.isTokenExpired(refreshToken)));
  }

  public isTokenExpired(token: string): boolean {
    return this.jwtService.isTokenExpired(token);
  }

  public saveAuth(accessToken: string, refreshToken: string, remember: boolean): void {
    this.clearAuth();
    this.setStorageItem(ACCESS_TOKEN_KEY, accessToken, remember);
    this.setStorageItem(REFRESH_TOKEN_KEY, refreshToken, remember);
  }

  public saveNewAuth(accessToken: string, refreshToken: string): void {
    this.setStorageItem(ACCESS_TOKEN_KEY, accessToken, !!localStorage.getItem(ACCESS_TOKEN_KEY));
    this.setStorageItem(REFRESH_TOKEN_KEY, refreshToken, !!localStorage.getItem(REFRESH_TOKEN_KEY));
  }

  public getAccessToken(): string {
    return this.getStorageItem(ACCESS_TOKEN_KEY);
  }

  private getRefreshToken(): string {
    return this.getStorageItem(REFRESH_TOKEN_KEY);
  }

  public clearAuth(): void {
    sessionStorage.removeItem(ACCESS_TOKEN_KEY);
    sessionStorage.removeItem(REFRESH_TOKEN_KEY);
    localStorage.removeItem(ACCESS_TOKEN_KEY);
    localStorage.removeItem(REFRESH_TOKEN_KEY);
  }

  private getStorageItem(key: string): string {
    const value = localStorage.getItem(key);
    return value ?? sessionStorage.getItem(key);
  }

  private setStorageItem(key: string, value: string, remember: boolean): void {
    if (remember) {
      localStorage.setItem(key, value);
    } else {
      sessionStorage.setItem(key, value);
    }
  }
}

